    vowel in the english alphabet. Assume only letters.

    Examples:
    >>> encode('test')
    'TGST'
    >>> encode('This is a message')
    'tHKS KS C MGSSCGG'
    """

    # Define a function to replace a vowel with the letter 2 places ahead
    def replace_vowel(char):
        if char in 'aeiouAEIOU':
            shift = 2
            while True:
                if char.islower():
                    if chr(ord(char) + shift) in 'aeiou':
                        shift += 1
                        continue
                    return chr(ord(char) + shift)
                else:
                    if chr(ord(char) + shift) in 'AEIOU':
                        shift += 1
                        continue
                    return chr(ord(char) + shift)
        else:
            return char

    # Define a function to swap case of a character
    def swap_case(char):
        if char.islower():
            return char.upper()
        else:
            return char.lower()

    # Process the message character by character
    encoded_message = ''
    for char in message:
        encoded_message += swap_case(replace_vowel(char))

    return encoded_message

