        return None

    # Calculate the product of signs of all numbers
    sign_product = 1
    for num in arr:
        if num > 0:
            sign_product *= 1
        elif num < 0:
            sign_product *= -1
        else:
            sign_product *= 0

    # Calculate the sum of magnitudes of all numbers
    magnitude_sum = 0
    for num in arr:
        magnitude_sum += abs(num)

    # Return the product of signs times sum of magnitudes
    return sign_product * magnitude_sum

